import logo from './logo.svg';
import './App.css';

import default_lat from './src/config';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h2 id='titulo'>El tiempo</h2>
        <div id='cabecera'>
        <img src={logo} className="logo" alt="logo" />
        <h3 className='mensaje'>Bienvenido a la página de Álvaro Torroba de Linos</h3>
        </div>
        <input id='latitud' value={default_lat}></input>
        <input id='longitud'></input>
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );
}

export default App;
